column2:
@tjrwriting are you going to use Alchemy?

if so it should be relatively straightforward so you're fine. 

the only thing to be wary of is that since you use your private key to deploy the smart contract, make sure you remember *not* to commit that to github.

@Loster @logseq Yep pretty much! Main notable differences for me so far are overall performance speed &amp; a better omnibar.

Given the similarities, it's easy to migrate over and have a better overall experience.

Also UI is a huge factor for me. I get *excited* to use Logseq vs the dread of Roam
